text('Parent',axes1,'VerticalAlignment','baseline','String','x^2',...
    'Position',[0.310643564356436 -0.348258706467662 0]);

% Create xlabel
xlabel('\Omega');

% Create title
title('Mans grafiks');

% Create ylabel
ylabel('U,V');

box(axes1,'on');
% Create legend
legend(axes1,'show');

